import React from "react";
import Antipodal from './Antipodal.js';
import Chosen from './Chosen.js';
import globe from './globe.svg';


export default function Middle() {
    return(
        <div>
                <Antipodal />
                <div>
                    <img
                    src="./globe.svg"
                    alt="circle with arrows at opposite poles"
                    width="100" />
                </div>
                <Chosen />
        </div>
    )
}
